import { Button } from "@mui/material";
import TextField from "@mui/material/TextField";
import styled from "styled-components";

const Container = styled.div`
  position: relative;
  top: 300px;
  left: 750px;
  width: 500px;
  display: flex;
  flex-direction: column;
`;

function Form(params) {
  return (
    <Container>
      <TextField id="nome" label="Nome" name="nome" variant="outlined" />
      <TextField id="email" label="Email" name="Email" variant="outlined" />
      <Button
        color="primary"
        type="submit"
        variant="contained"
        sx={{ position: "relative", left: "430px", top: "5px", width: "50px" }}
      >
        Send
      </Button>
    </Container>
  );
}

export default Form;
